import Navbar from "./Component/Navbar";
import { configureStore } from "@reduxjs/toolkit";
import cartSlice from "./store/cartSlice";

const store = configureStore({
  reducer: {
    cart: cartReducer,
  },
});

const App = () => {
  return (
    <div className="App">
      <BrowserRouter>
        <Navbar />
        <AppRouter />
      </BrowserRouter>
    </div>
  );
};

export default App;
